const dailyTemperatures = function(temperatures){
    // create a map 
    const temperatureMap = {};
    temperatures.forEach((temp, index) => {
        if(temperatureMap[temp]) (temperatureMap[temp]).push(index);
        else temperatureMap[temp] = [index]
    })
    console.log(temperatureMap);
    const results = [];
    for (let i = 0; i < temperatures.length; i++) {
        let currentTemp = temperatures[i];
        let nextTemp = currentTemp;
        while ( nextTemp < 101) {
            const index = temperatureMap[nextTemp];
            if(!index){
                nextTemp++;
            }
            let indexIterator = 0;
            while(indexIterator<index.length){
                if(index[indexIterator] > i){
                    results.push(index[indexIterator] - i);
                    indexIterator = index.length;
                } else {
                    index.shift();
                }
                // console.log(results);
            }
        }
        console.log(results);
    }


}
